-- ----------------------------
-- Table structure for `game_event`
-- ----------------------------
DROP TABLE IF EXISTS `game_event`;
CREATE TABLE `game_event` (
  `event_idx` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `target_char_idx` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '目标角色id',
  `source_char_idx` bigint(20) unsigned NOT NULL DEFAULT '0',
  `event_cmd` tinyint(1) NOT NULL COMMENT '事件类型',
  `bin_content` blob NOT NULL,
  `last_update_time` datetime NOT NULL DEFAULT '1970-01-01 00:00:00' COMMENT '最近更新时间',
  PRIMARY KEY (`event_idx`),
  KEY `targetCharID` (`target_char_idx`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=124 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of game_event
-- ----------------------------

-- ----------------------------
-- Table structure for `mail_box`
-- ----------------------------
DROP TABLE IF EXISTS `mail_box`;
CREATE TABLE `mail_box` (
  `mail_idx` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `mail_type` tinyint(4) unsigned NOT NULL COMMENT '类型',
  `spid` smallint(6) unsigned NOT NULL DEFAULT '0' COMMENT '渠道id',
  `receiver_idx` bigint(20) unsigned NOT NULL COMMENT '接收者',
  `sender_idx` bigint(20) unsigned NOT NULL,
  `sender_name` varchar(16) DEFAULT NULL,
  `send_time` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '发送时间，秒',
  `expire_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '期限 为0表示永不过期，秒',
  `delivery_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '延迟投递时间，秒',
  `flags` int(11) unsigned NOT NULL DEFAULT '0',
  `subject` varchar(128) DEFAULT NULL COMMENT '主题',
  `bin_mail_content` blob COMMENT '内容',
  `last_update_time` datetime NOT NULL DEFAULT '1970-01-01 00:00:00',
  PRIMARY KEY (`mail_idx`),
  KEY `recipient` (`receiver_idx`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of mail_box
-- ----------------------------

-- ----------------------------
-- Table structure for `mail_char_recv`
