DROP TABLE IF EXISTS `mail_char_recv`;
CREATE TABLE `mail_char_recv` (
  `char_idx` bigint(20) NOT NULL,
  `bin_mails` blob COMMENT '领取了哪些邮件',
  PRIMARY KEY (`char_idx`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of mail_char_recv
-- ----------------------------

