-- ----------------------------
-- Procedure structure for `SP_COUNTER_LIST`
-- ----------------------------
DROP PROCEDURE IF EXISTS `SP_COUNTER_LIST`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_COUNTER_LIST`(IN i_char_idx BIGINT)
