-- ----------------------------
-- Procedure structure for `SP_DB_EVENT_CREATE`
-- ----------------------------
DROP PROCEDURE IF EXISTS `SP_DB_EVENT_CREATE`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_DB_EVENT_CREATE`(IN i_target_idx bigint(20),
     IN i_source_idx bigint(20),
    IN i_event_cmd int(11) UNSIGNED,
      IN i_bin_content blob)
BEGIN
return_label:begin
		#防止相同事件插入
		if(exists(select 1 from `game_event` where target_char_idx = i_target_idx and source_char_idx = i_source_idx and event_cmd = i_event_cmd)) then
				leave return_label;
		end if;

		values(i_target_idx, i_source_idx, i_event_cmd, now(), i_bin_content);

end return_label;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `SP_DB_EVENT_LOAD`
-- ----------------------------
DROP PROCEDURE IF EXISTS `SP_DB_EVENT_LOAD`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_DB_EVENT_LOAD`(IN i_target_idx bigint(20))
BEGIN
     SELECT
            event_idx,
            target_char_idx,
            source_char_idx,
            event_cmd,
            bin_content
            from `game_event` where target_char_idx = i_target_idx;
END
;;
DELIMITER ;

-- ----------------------------
